import React from "react";
import { useEffect, useState } from "react";
import Card from "./Card";
const Navbar = ({mycity}) => {
  const [data, setdata] = useState([]);
  const [city,setcity]=useState();
  const option = {
    methos: "GET",
    headers: new Headers({
      "x-rapidapi-key": "55816bf15emshbef5892f101cc0cp1f2484jsnd49b93aef792",
      "x-rapidapi-host": "community-open-weather-map.p.rapidapi.com"
    })
  };
  useEffect(() => {
      console.log('object :', mycity);
      setcity(mycity);
      let URL = '';
      if(mycity!==undefined){
        setcity(mycity);
        URL = `https://community-open-weather-map.p.rapidapi.com/weather?q=${mycity}`;
        console.log(URL);
      }
      else{
        URL = `https://community-open-weather-map.p.rapidapi.com/weather?q=patiala`;
        console.log('else' ,URL);
      }
    fetch(URL, option)
      .then(res => res.json())
      .then(data => {
        setdata(data);
      });
      console.log('City: ',city);
  }, []);
  if (data.length != 0) {
    return (
      <div>
        <Card info={data} />
      </div>
    );
  } else {
    return <div />;
  }
};

export default Navbar;
